import{_ as e,c as s,o as n,ag as i}from"./chunks/framework.CxQVUucW.js";const u=JSON.parse('{"title":"Frequently Asked Questions","description":"","frontmatter":{},"headers":[],"relativePath":"content/faq.md","filePath":"content/faq.md","lastUpdated":null}'),t={name:"content/faq.md"};function l(o,a,r,p,c,d){return n(),s("div",null,[...a[0]||(a[0]=[i(`<h1 id="frequently-asked-questions" tabindex="-1">Frequently Asked Questions <a class="header-anchor" href="#frequently-asked-questions" aria-label="Permalink to &quot;Frequently Asked Questions&quot;">​</a></h1><p>Comprehensive answers to common questions about PAW Blockchain.</p><h2 id="general-questions" tabindex="-1">General Questions <a class="header-anchor" href="#general-questions" aria-label="Permalink to &quot;General Questions&quot;">​</a></h2><h3 id="what-is-paw-blockchain" tabindex="-1">What is PAW Blockchain? <a class="header-anchor" href="#what-is-paw-blockchain" aria-label="Permalink to &quot;What is PAW Blockchain?&quot;">​</a></h3><p>PAW is a high-performance blockchain platform designed specifically for decentralized finance (DeFi) applications. Built on the Cosmos SDK with Tendermint consensus, PAW combines speed, security, and powerful built-in features including a native DEX, staking, and on-chain governance.</p><p><strong>Key Features:</strong></p><ul><li>6-second block time</li><li>Thousands of transactions per second</li><li>Sub-cent transaction fees</li><li>Built-in decentralized exchange</li><li>Proof-of-Stake consensus</li><li>IBC interoperability</li></ul><h3 id="how-is-paw-different-from-other-blockchains" tabindex="-1">How is PAW different from other blockchains? <a class="header-anchor" href="#how-is-paw-different-from-other-blockchains" aria-label="Permalink to &quot;How is PAW different from other blockchains?&quot;">​</a></h3><p>PAW distinguishes itself through:</p><ol><li><strong>Native DEX</strong>: Built into the blockchain protocol, not a separate smart contract</li><li><strong>Optimized for DeFi</strong>: Purpose-built modules for trading, liquidity, and yield</li><li><strong>High Performance</strong>: Faster and cheaper than many competitors</li><li><strong>Interoperability</strong>: IBC-enabled for cross-chain transfers</li><li><strong>Community Governed</strong>: On-chain governance with token holder voting</li></ol><p><strong>Comparison:</strong></p><table tabindex="0"><thead><tr><th>Feature</th><th>PAW</th><th>Ethereum</th><th>BSC</th></tr></thead><tbody><tr><td>Block Time</td><td>6s</td><td>12s</td><td>3s</td></tr><tr><td>TX Fee</td><td>$0.001</td><td>$5-50</td><td>$0.10</td></tr><tr><td>Finality</td><td>6s</td><td>13min</td><td>45s</td></tr><tr><td>Native DEX</td><td>✅</td><td>❌</td><td>❌</td></tr></tbody></table><h3 id="who-created-paw" tabindex="-1">Who created PAW? <a class="header-anchor" href="#who-created-paw" aria-label="Permalink to &quot;Who created PAW?&quot;">​</a></h3><p>PAW was created by a team of blockchain developers and DeFi experts. The project is now fully decentralized with governance controlled by token holders. Development is open-source with contributions from the global community.</p><h3 id="is-paw-open-source" tabindex="-1">Is PAW open source? <a class="header-anchor" href="#is-paw-open-source" aria-label="Permalink to &quot;Is PAW open source?&quot;">​</a></h3><p>Yes! All PAW code is open source under the Apache 2.0 license:</p><ul><li><strong>Core</strong>: <a href="https://github.com/paw-chain/paw" target="_blank" rel="noreferrer">https://github.com/paw-chain/paw</a></li><li><strong>SDKs</strong>: <a href="https://github.com/paw-chain/sdks" target="_blank" rel="noreferrer">https://github.com/paw-chain/sdks</a></li><li><strong>Wallets</strong>: <a href="https://github.com/paw-chain/wallets" target="_blank" rel="noreferrer">https://github.com/paw-chain/wallets</a></li></ul><h3 id="what-is-the-paw-token-used-for" tabindex="-1">What is the PAW token used for? <a class="header-anchor" href="#what-is-the-paw-token-used-for" aria-label="Permalink to &quot;What is the PAW token used for?&quot;">​</a></h3><p>The PAW token has multiple uses:</p><ol><li><strong>Transaction Fees</strong>: Pay for all on-chain operations</li><li><strong>Staking</strong>: Secure the network and earn rewards</li><li><strong>Governance</strong>: Vote on proposals and protocol changes</li><li><strong>DEX Trading</strong>: Base trading pair for all assets</li><li><strong>Liquidity Provision</strong>: Earn fees by providing liquidity</li></ol><h3 id="what-is-the-total-supply-of-paw" tabindex="-1">What is the total supply of PAW? <a class="header-anchor" href="#what-is-the-total-supply-of-paw" aria-label="Permalink to &quot;What is the total supply of PAW?&quot;">​</a></h3><ul><li><strong>Total Supply</strong>: 1,000,000,000 PAW</li><li><strong>Initial Circulating</strong>: 300,000,000 PAW</li><li><strong>Inflation</strong>: 7-20% annually (decreasing over time)</li><li><strong>Distribution</strong>: See <a href="#tokenomics">Tokenomics</a></li></ul><h2 id="wallet-questions" tabindex="-1">Wallet Questions <a class="header-anchor" href="#wallet-questions" aria-label="Permalink to &quot;Wallet Questions&quot;">​</a></h2><h3 id="how-do-i-create-a-wallet" tabindex="-1">How do I create a wallet? <a class="header-anchor" href="#how-do-i-create-a-wallet" aria-label="Permalink to &quot;How do I create a wallet?&quot;">​</a></h3><p>PAW offers several wallet options:</p><ol><li><p><strong>Browser Extension</strong> (easiest):</p><ul><li>Install from Chrome Web Store or Firefox Add-ons</li><li>Click &quot;Create Wallet&quot;</li><li>Save recovery phrase</li><li>Done!</li></ul></li><li><p><strong>Desktop Application</strong> (full-featured):</p><ul><li>Download for Windows, macOS, or Linux</li><li>Install and launch</li><li>Create new wallet</li><li>Backup recovery phrase</li></ul></li><li><p><strong>Mobile App</strong> (on-the-go):</p><ul><li>Download from App Store or Google Play</li><li>Create wallet with biometric security</li><li>Backup recovery phrase</li></ul></li></ol><p><strong>See</strong>: <a href="#wallet-setup">Wallet Setup Tutorial</a></p><h3 id="what-if-i-lose-my-recovery-phrase" tabindex="-1">What if I lose my recovery phrase? <a class="header-anchor" href="#what-if-i-lose-my-recovery-phrase" aria-label="Permalink to &quot;What if I lose my recovery phrase?&quot;">​</a></h3><p>Unfortunately, your recovery phrase is the ONLY way to restore your wallet. If lost:</p><p>❌ <strong>Cannot be recovered</strong> by PAW team ❌ <strong>Cannot be reset</strong> or regenerated ❌ <strong>Funds are permanently inaccessible</strong></p><p><strong>Prevention:</strong></p><ul><li>Write on paper, never digital</li><li>Store in fireproof/waterproof safe</li><li>Consider metal backup plates</li><li>Keep multiple copies in secure locations</li><li>NEVER share with anyone</li></ul><h3 id="can-i-use-the-same-wallet-on-multiple-devices" tabindex="-1">Can I use the same wallet on multiple devices? <a class="header-anchor" href="#can-i-use-the-same-wallet-on-multiple-devices" aria-label="Permalink to &quot;Can I use the same wallet on multiple devices?&quot;">​</a></h3><p>Yes! Import your wallet using your recovery phrase:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>1. Install PAW wallet on new device</span></span>
<span class="line"><span>2. Click &quot;Import Wallet&quot;</span></span>
<span class="line"><span>3. Enter 24-word recovery phrase</span></span>
<span class="line"><span>4. Set new password (can be different)</span></span>
<span class="line"><span>5. Wallet restored with same address</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div><p>⚠️ <strong>Security Note:</strong> More devices = more attack surfaces. Only import on devices you trust.</p><h3 id="which-wallet-should-i-use" tabindex="-1">Which wallet should I use? <a class="header-anchor" href="#which-wallet-should-i-use" aria-label="Permalink to &quot;Which wallet should I use?&quot;">​</a></h3><p><strong>Recommendations:</strong></p><table tabindex="0"><thead><tr><th>Use Case</th><th>Recommended Wallet</th></tr></thead><tbody><tr><td>Casual user</td><td>Browser Extension</td></tr><tr><td>Frequent trader</td><td>Desktop App</td></tr><tr><td>Mobile access</td><td>Mobile App</td></tr><tr><td>Large holdings</td><td>Desktop + Hardware Wallet</td></tr><tr><td>Developer</td><td>CLI + Desktop</td></tr></tbody></table><p>You can use multiple wallets simultaneously!</p><h3 id="how-do-i-backup-my-wallet" tabindex="-1">How do I backup my wallet? <a class="header-anchor" href="#how-do-i-backup-my-wallet" aria-label="Permalink to &quot;How do I backup my wallet?&quot;">​</a></h3><p><strong>Recovery Phrase Method</strong> (Recommended):</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>1. Open wallet settings</span></span>
<span class="line"><span>2. Click &quot;Reveal Recovery Phrase&quot;</span></span>
<span class="line"><span>3. Enter password</span></span>
<span class="line"><span>4. Write down all 24 words IN ORDER</span></span>
<span class="line"><span>5. Verify by re-entering</span></span>
<span class="line"><span>6. Store safely offline</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br></div></div><p><strong>Encrypted Export</strong> (Desktop only):</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>1. File &gt; Export Wallet</span></span>
<span class="line"><span>2. Choose location</span></span>
<span class="line"><span>3. Set export password</span></span>
<span class="line"><span>4. Save encrypted JSON file</span></span>
<span class="line"><span>5. Store in multiple locations</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div><h3 id="can-i-change-my-wallet-address" tabindex="-1">Can I change my wallet address? <a class="header-anchor" href="#can-i-change-my-wallet-address" aria-label="Permalink to &quot;Can I change my wallet address?&quot;">​</a></h3><p>No. Your address is derived from your private key and cannot be changed. If you want a new address:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>1. Create new wallet (new recovery phrase)</span></span>
<span class="line"><span>2. Transfer funds to new address</span></span>
<span class="line"><span>3. Use new wallet going forward</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div><h2 id="transaction-questions" tabindex="-1">Transaction Questions <a class="header-anchor" href="#transaction-questions" aria-label="Permalink to &quot;Transaction Questions&quot;">​</a></h2><h3 id="how-long-do-transactions-take" tabindex="-1">How long do transactions take? <a class="header-anchor" href="#how-long-do-transactions-take" aria-label="Permalink to &quot;How long do transactions take?&quot;">​</a></h3><p><strong>Typical confirmation times:</strong></p><ul><li><strong>Block inclusion</strong>: 6 seconds (one block)</li><li><strong>Final confirmation</strong>: 6 seconds (Byzantine finality)</li><li><strong>Exchange deposits</strong>: 6-12 seconds (1-2 blocks)</li></ul><p><strong>Factors affecting speed:</strong></p><ul><li>Network congestion (rare)</li><li>Fee amount (higher = faster)</li><li>Validator connectivity</li></ul><h3 id="what-are-the-transaction-fees" tabindex="-1">What are the transaction fees? <a class="header-anchor" href="#what-are-the-transaction-fees" aria-label="Permalink to &quot;What are the transaction fees?&quot;">​</a></h3><p>PAW uses a gas-based fee model. Typical fees:</p><table tabindex="0"><thead><tr><th>Transaction Type</th><th>Gas</th><th>Fee (at 0.025 upaw/gas)</th></tr></thead><tbody><tr><td>Send Tokens</td><td>100,000</td><td>0.0025 PAW (~$0.002)</td></tr><tr><td>DEX Swap</td><td>200,000</td><td>0.005 PAW (~$0.005)</td></tr><tr><td>Add Liquidity</td><td>250,000</td><td>0.00625 PAW (~$0.006)</td></tr><tr><td>Stake Tokens</td><td>150,000</td><td>0.00375 PAW (~$0.004)</td></tr><tr><td>Vote</td><td>100,000</td><td>0.0025 PAW (~$0.002)</td></tr></tbody></table><p><strong>Fee Levels:</strong></p><ul><li>Low: 0.01 upaw/gas (slower)</li><li>Normal: 0.025 upaw/gas (recommended)</li><li>High: 0.05 upaw/gas (faster)</li></ul><h3 id="why-did-my-transaction-fail" tabindex="-1">Why did my transaction fail? <a class="header-anchor" href="#why-did-my-transaction-fail" aria-label="Permalink to &quot;Why did my transaction fail?&quot;">​</a></h3><p><strong>Common reasons:</strong></p><ol><li><p><strong>Insufficient Balance</strong></p><ul><li>Need balance + fee</li><li>Solution: Add more PAW</li></ul></li><li><p><strong>Invalid Address</strong></p><ul><li>Wrong format or typo</li><li>Solution: Verify address format</li></ul></li><li><p><strong>Network Issues</strong></p><ul><li>Node unavailable</li><li>Solution: Check network status</li></ul></li><li><p><strong>Out of Gas</strong></p><ul><li>Gas limit too low</li><li>Solution: Increase gas limit</li></ul></li><li><p><strong>Slippage</strong></p><ul><li>Price moved too much (DEX)</li><li>Solution: Increase slippage tolerance</li></ul></li></ol><p><strong>Check transaction on explorer</strong>: <a href="https://explorer.pawchain.io" target="_blank" rel="noreferrer">https://explorer.pawchain.io</a></p><h3 id="can-i-cancel-a-pending-transaction" tabindex="-1">Can I cancel a pending transaction? <a class="header-anchor" href="#can-i-cancel-a-pending-transaction" aria-label="Permalink to &quot;Can I cancel a pending transaction?&quot;">​</a></h3><p>Once broadcast, transactions cannot be cancelled. However:</p><ul><li>If truly stuck (rare), wait for timeout</li><li>Don&#39;t re-send same transaction (creates duplicate)</li><li>Contact support if urgent</li></ul><p><strong>Prevention:</strong></p><ul><li>Double-check details before confirming</li><li>Start with small test transaction</li><li>Verify recipient address</li></ul><h3 id="how-do-i-speed-up-a-slow-transaction" tabindex="-1">How do I speed up a slow transaction? <a class="header-anchor" href="#how-do-i-speed-up-a-slow-transaction" aria-label="Permalink to &quot;How do I speed up a slow transaction?&quot;">​</a></h3><p>If using desktop wallet or CLI:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>1. Check transaction status</span></span>
<span class="line"><span>2. If pending, can broadcast with higher fee</span></span>
<span class="line"><span>3. Use &quot;Speed Up&quot; feature if available</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div><p>Most transactions confirm in 6 seconds, so &quot;slow&quot; is unusual.</p><h3 id="what-is-a-memo-and-when-should-i-use-it" tabindex="-1">What is a memo and when should I use it? <a class="header-anchor" href="#what-is-a-memo-and-when-should-i-use-it" aria-label="Permalink to &quot;What is a memo and when should I use it?&quot;">​</a></h3><p>A memo is optional text attached to transactions:</p><p><strong>When to use:</strong></p><ul><li>Exchange deposits (often required)</li><li>Business transactions (invoice number)</li><li>Personal notes (gift, payment for X)</li></ul><p><strong>When NOT to use:</strong></p><ul><li>Normal wallet-to-wallet sends</li><li>Privacy-sensitive transactions</li><li>When not required</li></ul><p>⚠️ Memos are publicly visible on the blockchain!</p><h2 id="dex-questions" tabindex="-1">DEX Questions <a class="header-anchor" href="#dex-questions" aria-label="Permalink to &quot;DEX Questions&quot;">​</a></h2><h3 id="how-does-the-paw-dex-work" tabindex="-1">How does the PAW DEX work? <a class="header-anchor" href="#how-does-the-paw-dex-work" aria-label="Permalink to &quot;How does the PAW DEX work?&quot;">​</a></h3><p>The DEX uses an Automated Market Maker (AMM) model:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>Liquidity Pools (e.g., PAW/USDC)</span></span>
<span class="line"><span>    ↓</span></span>
<span class="line"><span>Users trade against pool</span></span>
<span class="line"><span>    ↓</span></span>
<span class="line"><span>Price adjusts via x*y=k formula</span></span>
<span class="line"><span>    ↓</span></span>
<span class="line"><span>Liquidity providers earn 0.3% fee</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br></div></div><p><strong>Benefits:</strong></p><ul><li>No order books</li><li>Always liquid</li><li>Permissionless</li><li>Non-custodial</li></ul><h3 id="what-is-slippage" tabindex="-1">What is slippage? <a class="header-anchor" href="#what-is-slippage" aria-label="Permalink to &quot;What is slippage?&quot;">​</a></h3><p>Slippage is the difference between expected and actual price:</p><p><strong>Example:</strong></p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>You want: 100 USDC</span></span>
<span class="line"><span>Expected: Pay 100 PAW (1:1 rate)</span></span>
<span class="line"><span>Actual: Pay 100.5 PAW (rate moved)</span></span>
<span class="line"><span>Slippage: 0.5%</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div><p><strong>Causes:</strong></p><ul><li>Large trade relative to pool size</li><li>Price volatility</li><li>Other trades executing simultaneously</li></ul><p><strong>Setting slippage tolerance:</strong></p><ul><li>0.1%: Very tight, may fail</li><li>0.5%: Recommended for stable pairs</li><li>1-5%: Volatile pairs or large trades</li></ul><h3 id="how-do-i-get-the-best-price-on-swaps" tabindex="-1">How do I get the best price on swaps? <a class="header-anchor" href="#how-do-i-get-the-best-price-on-swaps" aria-label="Permalink to &quot;How do I get the best price on swaps?&quot;">​</a></h3><p><strong>Tips:</strong></p><ol><li><p><strong>Compare Pools</strong></p><ul><li>Multiple pools may exist for same pair</li><li>Check each for best rate</li></ul></li><li><p><strong>Check Route</strong></p><ul><li>Direct route: PAW → USDC</li><li>Multi-hop: PAW → ETH → USDC</li><li>Fewer hops = better price</li></ul></li><li><p><strong>Timing</strong></p><ul><li>Avoid peak trading hours</li><li>Check 24h volume trends</li></ul></li><li><p><strong>Trade Size</strong></p><ul><li>Smaller trades = less price impact</li><li>Consider splitting large orders</li></ul></li><li><p><strong>Use Limit Orders</strong> (coming soon)</p><ul><li>Set exact price</li><li>Execute when available</li></ul></li></ol><h3 id="what-is-impermanent-loss" tabindex="-1">What is impermanent loss? <a class="header-anchor" href="#what-is-impermanent-loss" aria-label="Permalink to &quot;What is impermanent loss?&quot;">​</a></h3><p>Impermanent loss occurs when token prices diverge:</p><p><strong>Example:</strong></p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>Deposit: 100 PAW + 100 USDC (at 1:1)</span></span>
<span class="line"><span>Value: $200</span></span>
<span class="line"><span></span></span>
<span class="line"><span>PAW doubles to $2:</span></span>
<span class="line"><span>Pool rebalances to 70.7 PAW + 141.4 USDC</span></span>
<span class="line"><span>Value: $282.8</span></span>
<span class="line"><span></span></span>
<span class="line"><span>If just held: 100 PAW + 100 USDC</span></span>
<span class="line"><span>Value: $300</span></span>
<span class="line"><span></span></span>
<span class="line"><span>Impermanent Loss: $17.2 (5.7%)</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br></div></div><p><strong>Mitigation:</strong></p><ul><li>Choose stable pairs (USDC/USDT)</li><li>Fees compensate over time</li><li>Understand risk before providing liquidity</li></ul><p><strong>Not impermanent if:</strong></p><ul><li>Price returns to original ratio</li><li>You withdraw at same price</li></ul><h3 id="how-do-i-provide-liquidity" tabindex="-1">How do I provide liquidity? <a class="header-anchor" href="#how-do-i-provide-liquidity" aria-label="Permalink to &quot;How do I provide liquidity?&quot;">​</a></h3><p><strong>Step-by-step:</strong></p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>1. Choose pool (e.g., PAW/USDC)</span></span>
<span class="line"><span>2. Deposit equal value of both tokens</span></span>
<span class="line"><span>3. Receive LP tokens representing your share</span></span>
<span class="line"><span>4. Earn 0.3% of all trading fees</span></span>
<span class="line"><span>5. Remove liquidity anytime by burning LP tokens</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div><p><strong>Requirements:</strong></p><ul><li>Hold both tokens in pair</li><li>Approve token spending (one-time)</li><li>Pay gas for transactions</li></ul><p><strong>See</strong>: <a href="#liquidity-tutorial">Liquidity Tutorial</a></p><h3 id="what-are-lp-tokens" tabindex="-1">What are LP tokens? <a class="header-anchor" href="#what-are-lp-tokens" aria-label="Permalink to &quot;What are LP tokens?&quot;">​</a></h3><p>LP (Liquidity Provider) tokens are proof of your pool share:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>You deposit: 100 PAW + 98.5 USDC</span></span>
<span class="line"><span>Pool total: 10,000 PAW + 9,850 USDC</span></span>
<span class="line"><span>Your share: 1%</span></span>
<span class="line"><span>You receive: 99.2 LP tokens</span></span>
<span class="line"><span></span></span>
<span class="line"><span>LP tokens = claim on:</span></span>
<span class="line"><span>- 1% of pool assets</span></span>
<span class="line"><span>- 1% of trading fees</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br></div></div><p><strong>Important:</strong></p><ul><li>Don&#39;t lose LP tokens!</li><li>Needed to withdraw liquidity</li><li>Can be staked for extra rewards (coming soon)</li></ul><h2 id="staking-questions" tabindex="-1">Staking Questions <a class="header-anchor" href="#staking-questions" aria-label="Permalink to &quot;Staking Questions&quot;">​</a></h2><h3 id="how-does-staking-work" tabindex="-1">How does staking work? <a class="header-anchor" href="#how-does-staking-work" aria-label="Permalink to &quot;How does staking work?&quot;">​</a></h3><p>Stake PAW to validators who secure the network:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>You → Delegate PAW to Validator</span></span>
<span class="line"><span>Validator → Validates transactions and produces blocks</span></span>
<span class="line"><span>Network → Rewards validators</span></span>
<span class="line"><span>Validator → Shares rewards (minus commission)</span></span>
<span class="line"><span>You → Receive staking rewards</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div><h3 id="what-is-the-staking-apy" tabindex="-1">What is the staking APY? <a class="header-anchor" href="#what-is-the-staking-apy" aria-label="Permalink to &quot;What is the staking APY?&quot;">​</a></h3><p>APY varies based on:</p><ul><li>Total amount staked (lower = higher APY)</li><li>Inflation rate</li><li>Validator commission</li></ul><p><strong>Current estimates:</strong></p><ul><li>Base APY: 15-20%</li><li>After 5% commission: 14.25-19%</li><li>After 10% commission: 13.5-18%</li></ul><p><strong>Check current rates</strong>: <a href="https://dashboard.pawchain.io/staking" target="_blank" rel="noreferrer">https://dashboard.pawchain.io/staking</a></p><h3 id="what-is-the-unbonding-period" tabindex="-1">What is the unbonding period? <a class="header-anchor" href="#what-is-the-unbonding-period" aria-label="Permalink to &quot;What is the unbonding period?&quot;">​</a></h3><p>When you undelegate (unstake), there&#39;s a <strong>21-day unbonding period</strong>:</p><p>⏳ <strong>During unbonding:</strong></p><ul><li>Tokens locked (cannot use)</li><li>No rewards earned</li><li>Cannot cancel unbonding</li><li>Cannot redelegate</li></ul><p>✅ <strong>After 21 days:</strong></p><ul><li>Tokens become liquid</li><li>Can send/trade/stake elsewhere</li></ul><p><strong>Purpose:</strong> Security mechanism to prevent certain attacks</p><h3 id="how-do-i-choose-a-validator" tabindex="-1">How do I choose a validator? <a class="header-anchor" href="#how-do-i-choose-a-validator" aria-label="Permalink to &quot;How do I choose a validator?&quot;">​</a></h3><p><strong>Key factors:</strong></p><ol><li><p><strong>Commission</strong> (5-10% typical)</p><ul><li>Lower = more rewards for you</li><li>Too low = validator may not be sustainable</li></ul></li><li><p><strong>Uptime</strong> (aim for &gt;99%)</p><ul><li>Higher = more consistent rewards</li><li>Downtime = missed blocks = less rewards</li></ul></li><li><p><strong>Voting Power</strong> (&lt;5% recommended)</p><ul><li>Diversify for network health</li><li>Avoid top 10 validators</li></ul></li><li><p><strong>Self-Delegation</strong></p><ul><li>Validators with &quot;skin in the game&quot;</li><li>Shows commitment</li></ul></li><li><p><strong>Community Involvement</strong></p><ul><li>Active in governance</li><li>Good communication</li><li>Transparent operations</li></ul></li></ol><p><strong>Tool</strong>: <a href="https://dashboard.pawchain.io/validators" target="_blank" rel="noreferrer">Validator comparison</a></p><h3 id="can-i-stake-to-multiple-validators" tabindex="-1">Can I stake to multiple validators? <a class="header-anchor" href="#can-i-stake-to-multiple-validators" aria-label="Permalink to &quot;Can I stake to multiple validators?&quot;">​</a></h3><p>Yes! This is recommended:</p><p><strong>Benefits:</strong></p><ul><li>Risk diversification</li><li>Support decentralization</li><li>Optimize commission rates</li><li>Maximize uptime</li></ul><p><strong>Example strategy:</strong></p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>1000 PAW split across:</span></span>
<span class="line"><span>- 400 PAW to Validator A (5% comm, 99.9% uptime)</span></span>
<span class="line"><span>- 300 PAW to Validator B (7% comm, 99.7% uptime)</span></span>
<span class="line"><span>- 300 PAW to Validator C (6% comm, 99.8% uptime)</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div><h3 id="what-happens-if-my-validator-gets-slashed" tabindex="-1">What happens if my validator gets slashed? <a class="header-anchor" href="#what-happens-if-my-validator-gets-slashed" aria-label="Permalink to &quot;What happens if my validator gets slashed?&quot;">​</a></h3><p><strong>Slashing</strong> is a penalty for validator misbehavior:</p><p><strong>Reasons:</strong></p><ul><li>Double-signing blocks (severe)</li><li>Extended downtime (minor)</li></ul><p><strong>Penalties:</strong></p><ul><li>5% slash for downtime</li><li>20% slash for double-signing (rare)</li></ul><p><strong>Your stake:</strong></p><ul><li>You lose same percentage</li><li>Very rare in practice</li><li>Choose reputable validators</li></ul><p><strong>Protection:</strong></p><ul><li>Diversify across validators</li><li>Monitor validator performance</li><li>Check community reputation</li></ul><h3 id="how-often-should-i-claim-rewards" tabindex="-1">How often should I claim rewards? <a class="header-anchor" href="#how-often-should-i-claim-rewards" aria-label="Permalink to &quot;How often should I claim rewards?&quot;">​</a></h3><p><strong>Considerations:</strong></p><p><strong>Claim frequently:</strong></p><ul><li>✅ Compound more often (higher returns)</li><li>❌ Pay more gas fees</li><li>Best if: Large stake, low gas prices</li></ul><p><strong>Claim infrequently:</strong></p><ul><li>✅ Lower total gas fees</li><li>❌ Less compounding benefit</li><li>Best if: Small stake</li></ul><p><strong>Recommendation:</strong></p><ul><li>Small stake (&lt;1000 PAW): Monthly</li><li>Medium (1000-10000): Weekly</li><li>Large (&gt;10000): Daily or auto-compound when available</li></ul><h2 id="governance-questions" tabindex="-1">Governance Questions <a class="header-anchor" href="#governance-questions" aria-label="Permalink to &quot;Governance Questions&quot;">​</a></h2><h3 id="how-do-i-vote-on-proposals" tabindex="-1">How do I vote on proposals? <a class="header-anchor" href="#how-do-i-vote-on-proposals" aria-label="Permalink to &quot;How do I vote on proposals?&quot;">​</a></h3><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>1. Go to governance dashboard</span></span>
<span class="line"><span>2. View active proposals</span></span>
<span class="line"><span>3. Click proposal to read details</span></span>
<span class="line"><span>4. Research and discuss</span></span>
<span class="line"><span>5. Click &quot;Vote&quot;</span></span>
<span class="line"><span>6. Choose: Yes, No, Abstain, or No with Veto</span></span>
<span class="line"><span>7. Confirm transaction</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br></div></div><p><strong>Voting power</strong> = your staked PAW</p><h3 id="what-types-of-proposals-are-there" tabindex="-1">What types of proposals are there? <a class="header-anchor" href="#what-types-of-proposals-are-there" aria-label="Permalink to &quot;What types of proposals are there?&quot;">​</a></h3><ol><li><p><strong>Text Proposals</strong></p><ul><li>General community decisions</li><li>Non-binding recommendations</li></ul></li><li><p><strong>Parameter Changes</strong></p><ul><li>Modify blockchain parameters</li><li>E.g., fee amounts, block size</li></ul></li><li><p><strong>Software Upgrades</strong></p><ul><li>Coordinate network upgrades</li><li>Critical for major changes</li></ul></li><li><p><strong>Community Pool Spending</strong></p><ul><li>Allocate treasury funds</li><li>Fund development, marketing, etc.</li></ul></li></ol><h3 id="what-does-each-vote-option-mean" tabindex="-1">What does each vote option mean? <a class="header-anchor" href="#what-does-each-vote-option-mean" aria-label="Permalink to &quot;What does each vote option mean?&quot;">​</a></h3><ul><li><strong>Yes</strong>: Support the proposal</li><li><strong>No</strong>: Oppose but allow execution if passes</li><li><strong>No with Veto</strong>: Strong opposition, proposal fails if &gt;33.4% veto</li><li><strong>Abstain</strong>: Participate in quorum but stay neutral</li></ul><h3 id="can-i-change-my-vote" tabindex="-1">Can I change my vote? <a class="header-anchor" href="#can-i-change-my-vote" aria-label="Permalink to &quot;Can I change my vote?&quot;">​</a></h3><p>Yes, until the voting period ends:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>1. Go to proposal</span></span>
<span class="line"><span>2. Click &quot;Change Vote&quot;</span></span>
<span class="line"><span>3. Select new option</span></span>
<span class="line"><span>4. Confirm</span></span>
<span class="line"><span>5. Previous vote overwritten</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div><h3 id="what-is-the-community-pool" tabindex="-1">What is the community pool? <a class="header-anchor" href="#what-is-the-community-pool" aria-label="Permalink to &quot;What is the community pool?&quot;">​</a></h3><p>A treasury of PAW tokens used for ecosystem development:</p><p><strong>Current balance</strong>: Check on governance page</p><p><strong>Funding</strong>: 2% of block rewards</p><p><strong>Usage</strong>: Community spend proposals</p><ul><li>Development grants</li><li>Marketing initiatives</li><li>Security audits</li><li>Community events</li></ul><h3 id="how-do-i-create-a-proposal" tabindex="-1">How do I create a proposal? <a class="header-anchor" href="#how-do-i-create-a-proposal" aria-label="Permalink to &quot;How do I create a proposal?&quot;">​</a></h3><p><strong>Requirements:</strong></p><ul><li>Minimum deposit: 100 PAW</li><li>Clear description</li><li>Community discussion</li></ul><p><strong>Process:</strong></p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>1. Draft proposal (use template)</span></span>
<span class="line"><span>2. Discuss on forum</span></span>
<span class="line"><span>3. Refine based on feedback</span></span>
<span class="line"><span>4. Submit on-chain</span></span>
<span class="line"><span>5. Deposit tokens</span></span>
<span class="line"><span>6. 2-week voting period</span></span>
<span class="line"><span>7. Implementation if passed</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br></div></div><p><strong>See</strong>: <a href="#">Proposal Guide</a></p><h2 id="technical-questions" tabindex="-1">Technical Questions <a class="header-anchor" href="#technical-questions" aria-label="Permalink to &quot;Technical Questions&quot;">​</a></h2><h3 id="what-consensus-mechanism-does-paw-use" tabindex="-1">What consensus mechanism does PAW use? <a class="header-anchor" href="#what-consensus-mechanism-does-paw-use" aria-label="Permalink to &quot;What consensus mechanism does PAW use?&quot;">​</a></h3><p><strong>Tendermint BFT</strong> (Byzantine Fault Tolerant):</p><ul><li>Proof-of-Stake</li><li>Instant finality</li><li>Up to 1/3 malicious validators tolerated</li><li>Used by Cosmos, Binance Chain, and others</li></ul><h3 id="is-paw-compatible-with-ethereum" tabindex="-1">Is PAW compatible with Ethereum? <a class="header-anchor" href="#is-paw-compatible-with-ethereum" aria-label="Permalink to &quot;Is PAW compatible with Ethereum?&quot;">​</a></h3><p>Not directly, but:</p><p><strong>Similar:</strong></p><ul><li>Same cryptography (secp256k1)</li><li>Similar account system</li></ul><p><strong>Different:</strong></p><ul><li>Different address format (bech32 vs hex)</li><li>Different transaction structure</li><li>Uses Cosmos SDK, not EVM</li></ul><p><strong>Bridges:</strong> Coming soon for cross-chain transfers</p><h3 id="what-is-ibc" tabindex="-1">What is IBC? <a class="header-anchor" href="#what-is-ibc" aria-label="Permalink to &quot;What is IBC?&quot;">​</a></h3><p><strong>Inter-Blockchain Communication Protocol</strong>:</p><ul><li>Transfer assets between Cosmos chains</li><li>Trustless bridging</li><li>100+ compatible chains</li><li>PAW IBC: Coming Q2 2025</li></ul><h3 id="can-i-run-my-own-validator" tabindex="-1">Can I run my own validator? <a class="header-anchor" href="#can-i-run-my-own-validator" aria-label="Permalink to &quot;Can I run my own validator?&quot;">​</a></h3><p>Yes! Requirements:</p><p><strong>Hardware:</strong></p><ul><li>4 CPU cores</li><li>16GB RAM</li><li>500GB SSD</li><li>100Mbps connection</li></ul><p><strong>Stake:</strong></p><ul><li>Minimum self-delegation varies</li><li>Recommend 10,000+ PAW</li></ul><p><strong>Technical:</strong></p><ul><li>Linux server administration</li><li>24/7 monitoring</li><li>Security best practices</li></ul><p><strong>See</strong>: <a href="#">Validator Setup Guide</a></p><h2 id="security-questions" tabindex="-1">Security Questions <a class="header-anchor" href="#security-questions" aria-label="Permalink to &quot;Security Questions&quot;">​</a></h2><h3 id="is-paw-secure" tabindex="-1">Is PAW secure? <a class="header-anchor" href="#is-paw-secure" aria-label="Permalink to &quot;Is PAW secure?&quot;">​</a></h3><p>Yes, PAW employs multiple security measures:</p><ul><li>✅ Audited codebase</li><li>✅ Tendermint BFT consensus</li><li>✅ Validator set of 100+</li><li>✅ Slashing for misbehavior</li><li>✅ Open-source code</li><li>✅ Bug bounty program</li></ul><p><strong>Audits</strong>: <a href="https://docs.pawchain.io/security" target="_blank" rel="noreferrer">https://docs.pawchain.io/security</a></p><h3 id="what-should-i-do-if-i-m-scammed" tabindex="-1">What should I do if I&#39;m scammed? <a class="header-anchor" href="#what-should-i-do-if-i-m-scammed" aria-label="Permalink to &quot;What should I do if I&#39;m scammed?&quot;">​</a></h3><p><strong>Prevention</strong> is key:</p><ul><li>Verify all URLs</li><li>Never share recovery phrase</li><li>Beware of impersonators</li><li>Use official wallets only</li></ul><p><strong>If scammed:</strong></p><ol><li><strong>Don&#39;t panic</strong></li><li><strong>Move remaining funds</strong> to new wallet immediately</li><li><strong>Report</strong> to <a href="mailto:security@pawchain.io" target="_blank" rel="noreferrer">security@pawchain.io</a></li><li><strong>Alert community</strong> on Discord/Forum</li><li><strong>File report</strong> with local authorities if applicable</li></ol><p>⚠️ Blockchain transactions are irreversible!</p><h3 id="how-can-i-report-a-vulnerability" tabindex="-1">How can I report a vulnerability? <a class="header-anchor" href="#how-can-i-report-a-vulnerability" aria-label="Permalink to &quot;How can I report a vulnerability?&quot;">​</a></h3><p>PAW has a bug bounty program:</p><ol><li><strong>Do NOT</strong> disclose publicly</li><li><strong>Email</strong>: <a href="mailto:security@pawchain.io" target="_blank" rel="noreferrer">security@pawchain.io</a></li><li><strong>Include</strong>: Detailed report</li><li><strong>Wait</strong>: For team response</li><li><strong>Receive</strong>: Bounty reward</li></ol><p><strong>Rewards</strong>:</p><ul><li>Critical: $10,000 - $50,000</li><li>High: $5,000 - $10,000</li><li>Medium: $1,000 - $5,000</li><li>Low: $500 - $1,000</li></ul><p><strong>Details</strong>: <a href="https://docs.pawchain.io/bug-bounty" target="_blank" rel="noreferrer">https://docs.pawchain.io/bug-bounty</a></p><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h2><h3 id="my-balance-isn-t-showing" tabindex="-1">My balance isn&#39;t showing <a class="header-anchor" href="#my-balance-isn-t-showing" aria-label="Permalink to &quot;My balance isn&#39;t showing&quot;">​</a></h3><p><strong>Solutions:</strong></p><ol><li>Refresh wallet</li><li>Check network connection</li><li>Verify correct network (mainnet vs testnet)</li><li>Try different RPC endpoint</li><li>Update wallet software</li><li>Re-import wallet if needed</li></ol><h3 id="transaction-is-stuck" tabindex="-1">Transaction is stuck <a class="header-anchor" href="#transaction-is-stuck" aria-label="Permalink to &quot;Transaction is stuck&quot;">​</a></h3><p><strong>Steps:</strong></p><ol><li>Wait 5 minutes (may just be delayed)</li><li>Check explorer: <a href="https://explorer.pawchain.io" target="_blank" rel="noreferrer">https://explorer.pawchain.io</a></li><li>Verify transaction was broadcast</li><li>Check RPC status: <a href="https://status.pawchain.io" target="_blank" rel="noreferrer">https://status.pawchain.io</a></li><li>Contact support if &gt;1 hour</li></ol><h3 id="cannot-connect-to-network" tabindex="-1">Cannot connect to network <a class="header-anchor" href="#cannot-connect-to-network" aria-label="Permalink to &quot;Cannot connect to network&quot;">​</a></h3><p><strong>Solutions:</strong></p><ol><li>Check internet connection</li><li>Verify RPC endpoint</li><li>Try alternative RPC: <ul><li><a href="https://rpc.pawchain.io" target="_blank" rel="noreferrer">https://rpc.pawchain.io</a></li><li><a href="https://rpc2.pawchain.io" target="_blank" rel="noreferrer">https://rpc2.pawchain.io</a></li></ul></li><li>Check firewall/VPN</li><li>Update wallet</li></ol><h2 id="getting-help" tabindex="-1">Getting Help <a class="header-anchor" href="#getting-help" aria-label="Permalink to &quot;Getting Help&quot;">​</a></h2><h3 id="where-can-i-get-support" tabindex="-1">Where can I get support? <a class="header-anchor" href="#where-can-i-get-support" aria-label="Permalink to &quot;Where can I get support?&quot;">​</a></h3><p><strong>Documentation</strong>: <a href="https://docs.pawchain.io" target="_blank" rel="noreferrer">docs.pawchain.io</a><strong>Discord</strong>: <a href="https://discord.gg/pawchain" target="_blank" rel="noreferrer">discord.gg/pawchain</a><strong>Telegram</strong>: <a href="https://t.me/pawchain" target="_blank" rel="noreferrer">t.me/pawchain</a><strong>Forum</strong>: <a href="https://forum.pawchain.io" target="_blank" rel="noreferrer">forum.pawchain.io</a><strong>Email</strong>: <a href="mailto:support@pawchain.io" target="_blank" rel="noreferrer">support@pawchain.io</a></p><p><strong>Response times:</strong></p><ul><li>Discord/Telegram: Minutes to hours</li><li>Forum: Hours to 1 day</li><li>Email: 1-3 business days</li></ul><h3 id="is-there-a-knowledge-base" tabindex="-1">Is there a knowledge base? <a class="header-anchor" href="#is-there-a-knowledge-base" aria-label="Permalink to &quot;Is there a knowledge base?&quot;">​</a></h3><p>Yes! This documentation site:</p><ul><li><a href="#getting-started">Getting Started</a></li><li><a href="#user-guide">User Guide</a></li><li><a href="#developer-guide">Developer Guide</a></li><li><a href="#tutorials">Tutorials</a></li><li><a href="#faq">This FAQ</a></li></ul><h3 id="how-can-i-contribute" tabindex="-1">How can I contribute? <a class="header-anchor" href="#how-can-i-contribute" aria-label="Permalink to &quot;How can I contribute?&quot;">​</a></h3><p><strong>Ways to help:</strong></p><ol><li><strong>Code</strong>: Submit PRs on GitHub</li><li><strong>Documentation</strong>: Improve docs</li><li><strong>Community</strong>: Help others on Discord</li><li><strong>Translation</strong>: Translate docs</li><li><strong>Testing</strong>: Test new features</li><li><strong>Marketing</strong>: Spread the word</li></ol><p><strong>Start here</strong>: <a href="https://github.com/paw-chain/paw" target="_blank" rel="noreferrer">https://github.com/paw-chain/paw</a></p><hr><p><em>Can&#39;t find your question? Ask on <a href="https://discord.gg/pawchain" target="_blank" rel="noreferrer">Discord</a> or <a href="https://forum.pawchain.io" target="_blank" rel="noreferrer">Forum</a></em></p>`,247)])])}const g=e(t,[["render",l]]);export{u as __pageData,g as default};
